import React from "react";
import App from "./App";
import ReactDOM from "react-dom/client";
import {AuthContext} from "../authcontext/AuthContext";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <AuthContext>
            <App/>
        </AuthContext>
    </React.StrictMode>
);
